import { Box, Typography, Grid } from "@mui/material";
import React from "react";
import Card from '@mui/material/Card';
import CardActions from '@mui/material/CardActions';
import CardContent from '@mui/material/CardContent';
import Button from '@mui/material/Button';
export default function SubscribegGraph() {
    return (
        <Box sx={{ height: '600px', background: 'gray' ,marginTop:'90px'}}>
            <Typography className="test-script-regular">Subscribe to<span className="test-script-bg"> opportunities curated</span> for you</Typography>
            <Grid sx={{marginTop:'40px',width:'max-content'}} container spacing={2}>
                <Grid  item xs={6}>
                    <Card sx={{ width: '100%', height: 360 }}>
                        <CardContent>

                        </CardContent>
                    </Card>
                </Grid>
                <Grid item xs={6}>
                    <Card sx={{ width: '100%', height: 360 }}>
                        <CardContent>
                           <Typography>Equity linked instruments</Typography>
                           <Typography>Subscribe to gain access to exclusive high return opportunities in growing business</Typography>
                           <Typography>25%+</Typography>
                           <Typography>Expected IRR</Typography>
                           <Button varient='contained'></Button>
                        </CardContent>
                    </Card>
                </Grid>
            </Grid>

        </Box>
    )
}
